schemaDefinition: "create or replace view PPR_RPT_PARTNER_FUTURE12MONTHS_EVALUATION_RESALE(\n\
  \t\"ParentPartnerSysID\",\n\t\"ParentPartner\",\n\t\"ParentPartnerNumber\",\n\t\"\
  ProgramType\",\n\t\"ParentPartnerPublicSectorFlag\",\n\t\"ParentPartnerPublicSectorFlagFuture\"\
  ,\n\t\"3C\",\n\t\"Criteria\",\n\t\"CriteriaValCompletedDaily\",\n\t\"PSCriteriaValCompletedDaily\"\
  ,\n\t\"PotentialCriteriaSegment\",\n\t\"CriteriaThresholdLowerLimit\",\n\t\"FutureGap\"\
  ,\n\t\"PSGap\",\n\t\"CriteriaValCompleted12Months_Actual\",\n\t\"PSCriteriaValCompleted12Months_Actual\"\
  ,\n\t\"WTCriteriaValCompleted12Months_Actual\",\n\t\"CriteriaValCompleted12Months\"\
  ,\n\t\"PSCriteriaValCompleted12Months\",\n\t\"WTCriteriaValCompleted12Months\",\n\
  \t\"CurrentCriteriaSegment\",\n\t\"Gap\",\n\t\"PSFutureGap\",\n\t\"MonthlyProgramEvaluatedDate\"\
  ,\n\t\"DailyChangeFlag\",\n\t\"DeleteFlagMonthly\",\n\t\"DeletedDateMonthly\",\n\
  \t\"WaivedUntil\"\n) as\n/*********************************************************************************************************************\n\
  \ \t\t* Project  Name              :     Partner Program Redesign\n \t\t* Project\
  \ \t\t\t\t\t :\n \t\t* Object Name \t\t\t\t :     PPR_RPT_PARTNER_FUTURE12MONTHS_EVALUATION_RESALE\n\
  \ \t\t* Development Request # \t :\n \t\t* Brief Description          : \t   global\
  \ elite Evaluation Data Future12months\n \t\t* Developed By               :    \
  \ Vaidehi\n \t\t* Date Created               : \t   2023-06-21\n \t\t* ---------------------------------------------------------------------------------------------------------------\n\
  \ \t\t* REVISION HISTORY:\n \t\t* SFSTRY0133351     2024-07-04     sreeja O V  \
  \ Switching the 3C rules static  table  to partner portal table\n\n \t\t*----------------------------------------------------------------------------------------------------------------\n\
  \nCriteriaSysId-ParentCriteriaName-CriteriaName\n\n57460e5b1b1bb514534ffd115b4bcb80\
  \  -  Approved Deal Registrations  -  Approved Deal Registrations\n5b460e5b1b1bb514534ffd115b4bcb7e\
  \  -  Impacted Resale NNACV  -  Impacted Resale NNACV\n93460e5b1b1bb514534ffd115b4bcb83\
  \  -  Net New Logos Win  -  Net New Logos\n9f460e5b1b1bb514534ffd115b4bcb7f  - \
  \ Sourced Resale NNACV  -  Sourced Resale NNACV\n57460e5b1b1bb514534ffd115b4bcba4\
  \  -  Resources completed Sales & Messaging Foundations Path (NowLearning)  -  Sales\
  \ & Messaging Foundations\n93460e5b1b1bb514534ffd115b4bcb86  -  Sales and pre-sales\
  \ competency across # product lines  -  Sales and Pre-sales competency across product\
  \ lines\n17460e5b1b1bb514534ffd115b4bcb91  -  Skilled Pre-sales Resources  -  Pre-sales\
  \ Accreditations\n1f460e5b1b1bb514534ffd115b4bcb90  -  Skilled Sales Resources \
  \ -  Sales Accreditations\n5b460e5b1b1bb514534ffd115b4bcb83  -  Approved Resale\
  \ Customer Success Stories  -  Customer Success Stories\n\n ********************************************************************************************************************************/\n\
  (\n\nWITH C_RULES AS(\n\n  SELECT DISTINCT\n  \"ProgramType\",\"3C_Category\",\"\
  CriteriaSysId\",\"ParentCriteriaName\",\"CriteriaName\",\"CriteriaDetails\",\"Competency_SkillSysID\"\
  ,\"CriteriaDefinition\",\n\"Operator\", \"CriteriaMinimumRequirement\", \"CriteriaMinimumRequirementThreshold\"\
  ,\n \"CriteriaThresholdLowerLimit\",\n\"CriteriaThresholdUpperLimit\",\n \"ProgramSegment\"\
  ,\"Active\",\"ValidFrom\",\"ValidTo\",\"UpdatedDate\",\"UpdatedByUser\",\"PublicSectorMultiplier\"\
  \ ,\"WaivedUntil\"\n  FROM ODS_LS.PARTNER.X_SNC_4C_PARTNER_F_3C_RULES WHERE \"ProgramType\"\
  ='random' AND \"Active\" = 'random'\nunion all\n-- Approved Deal Registrations\n\
  \ select \"ProgramType\",\"3C_Category\",\"CriteriaSysId\",\"ParentCriteriaName\"\
  ,\"CriteriaName\",\"CriteriaDetails\",\"Competency_SkillSysID\",\"CriteriaDefinition\"\
  ,\n\"Operator\", \"CriteriaMinimumRequirement\", \"CriteriaMinimumRequirementThreshold\"\
  ,\n'random' as \"CriteriaThresholdLowerLimit\",\n\"CriteriaThresholdLowerLimit\"\
  \ - 'random'  as \"CriteriaThresholdUpperLimit\",\n'random' as \"ProgramSegment\"\
  ,\"Active\",\"ValidFrom\",\"ValidTo\",\"UpdatedDate\",\"UpdatedByUser\",\"PublicSectorMultiplier\"\
  \ ,\"WaivedUntil\"\nfrom  ODS_LS.PARTNER.X_SNC_4C_PARTNER_F_3C_RULES\nwhere \"CriteriaSysId\"\
  \ in ('random')\n--\"ParentCriteriaName\" in ('Approved Deal Registrations' )\n\
  and  \"ProgramSegment\" = 'random' and \"ProgramType\" = 'random' and \"3C_Category\"\
  \ = 'random'\nunion all\n-- Approved Deal Registrations\n select \"ProgramType\"\
  ,\"3C_Category\",\"CriteriaSysId\",\"ParentCriteriaName\",\"CriteriaName\",\"CriteriaDetails\"\
  ,\"Competency_SkillSysID\",\"CriteriaDefinition\",\n\"Operator\", \"CriteriaMinimumRequirement\"\
  , \"CriteriaMinimumRequirementThreshold\",\n'random' as \"CriteriaThresholdLowerLimit\"\
  ,\n\"CriteriaThresholdLowerLimit\" - 'random'  as \"CriteriaThresholdUpperLimit\"\
  ,\n'random' as \"ProgramSegment\",\"Active\",\"ValidFrom\",\"ValidTo\",\"UpdatedDate\"\
  ,\"UpdatedByUser\",\"PublicSectorMultiplier\" ,\"WaivedUntil\"\nfrom  ODS_LS.PARTNER.X_SNC_4C_PARTNER_F_3C_RULES\n\
  where \"CriteriaSysId\" in ('random')\n--\"ParentCriteriaName\" in ('Approved Deal\
  \ Registrations' )\nand  \"ProgramSegment\" = 'random' and \"ProgramType\" = 'random'\
  \ and \"3C_Category\" = 'random'\nunion all\n-- Approved Resale Customer Success\
  \ Stories\n select \"ProgramType\",\"3C_Category\",\"CriteriaSysId\",\"ParentCriteriaName\"\
  ,\"CriteriaName\",\"CriteriaDetails\",\"Competency_SkillSysID\",\"CriteriaDefinition\"\
  ,\n\"Operator\", \"CriteriaMinimumRequirement\", \"CriteriaMinimumRequirementThreshold\"\
  ,\n'random' as \"CriteriaThresholdLowerLimit\",\n\"CriteriaThresholdLowerLimit\"\
  \ - 'random'  as \"CriteriaThresholdUpperLimit\",\n'random' as \"ProgramSegment\"\
  ,\"Active\",\"ValidFrom\",\"ValidTo\",\"UpdatedDate\",\"UpdatedByUser\",\"PublicSectorMultiplier\"\
  \ ,\"WaivedUntil\"\nfrom  ODS_LS.PARTNER.X_SNC_4C_PARTNER_F_3C_RULES\nwhere \"CriteriaSysId\"\
  \ in ('random')\n--\"ParentCriteriaName\" in ('Approved Resale Customer Success\
  \ Stories' )\nand  \"ProgramSegment\" = 'random' and \"ProgramType\" = 'random'\
  \ and \"3C_Category\" =  'random'\nunion all\n-- Net New Logos Win\n select \"ProgramType\"\
  ,\"3C_Category\",\"CriteriaSysId\",\"ParentCriteriaName\",\"CriteriaName\",\"CriteriaDetails\"\
  ,\"Competency_SkillSysID\",\"CriteriaDefinition\",\n\"Operator\", \"CriteriaMinimumRequirement\"\
  , \"CriteriaMinimumRequirementThreshold\",\n'random' as \"CriteriaThresholdLowerLimit\"\
  ,\n\"CriteriaThresholdLowerLimit\" - 'random'  as \"CriteriaThresholdUpperLimit\"\
  ,\n'random' as \"ProgramSegment\",\"Active\",\"ValidFrom\",\"ValidTo\",\"UpdatedDate\"\
  ,\"UpdatedByUser\",\"PublicSectorMultiplier\" ,\"WaivedUntil\"\nfrom  ODS_LS.PARTNER.X_SNC_4C_PARTNER_F_3C_RULES\n\
  where \"CriteriaSysId\" in ('random')\n--\"ParentCriteriaName\" in ('Net New Logos\
  \ Win' )\nand  \"ProgramSegment\" = 'random' and \"ProgramType\" = 'random' and\
  \ \"3C_Category\" = 'random'\nunion all\n-- Impacted Resale NNACV'\n select \"ProgramType\"\
  ,\"3C_Category\",\"CriteriaSysId\",\"ParentCriteriaName\",\"CriteriaName\",\"CriteriaDetails\"\
  ,\"Competency_SkillSysID\",\"CriteriaDefinition\",\n\"Operator\", \"CriteriaMinimumRequirement\"\
  , \"CriteriaMinimumRequirementThreshold\",\n'random' as \"CriteriaThresholdLowerLimit\"\
  ,\n\"CriteriaThresholdLowerLimit\" - 'random'  as \"CriteriaThresholdUpperLimit\"\
  ,\n'random' as \"ProgramSegment\",\"Active\",\"ValidFrom\",\"ValidTo\",\"UpdatedDate\"\
  ,\"UpdatedByUser\",\"PublicSectorMultiplier\" ,\"WaivedUntil\"\nfrom  ODS_LS.PARTNER.X_SNC_4C_PARTNER_F_3C_RULES\n\
  where \"CriteriaSysId\" in ('random')\n--\"ParentCriteriaName\" in ('Impacted Resale\
  \ NNACV' )\nand  \"ProgramSegment\" = 'random' and \"ProgramType\" = 'random' and\
  \ \"3C_Category\" = 'random'\nunion all\n-- Sourced Resale NNACV'\nselect \"ProgramType\"\
  ,\"3C_Category\",\"CriteriaSysId\",\"ParentCriteriaName\",\"CriteriaName\",\"CriteriaDetails\"\
  ,\"Competency_SkillSysID\",\"CriteriaDefinition\",\n\"Operator\", \"CriteriaMinimumRequirement\"\
  , \"CriteriaMinimumRequirementThreshold\",\n'random' as \"CriteriaThresholdLowerLimit\"\
  ,\n\"CriteriaThresholdLowerLimit\" - 'random'  as \"CriteriaThresholdUpperLimit\"\
  ,\n'random' as \"ProgramSegment\",\"Active\",\"ValidFrom\",\"ValidTo\",\"UpdatedDate\"\
  ,\"UpdatedByUser\",\"PublicSectorMultiplier\" ,\"WaivedUntil\"\nfrom  ODS_LS.PARTNER.X_SNC_4C_PARTNER_F_3C_RULES\n\
  where \"CriteriaSysId\" in ('random')\n--\"ParentCriteriaName\" in ('Sourced Resale\
  \ NNACV' )\nand  \"ProgramSegment\" = 'random' and \"ProgramType\" = 'random' and\
  \ \"3C_Category\" = 'random'\n    union all\n    --Skilled Sales Resources\n   \
  \ select \"ProgramType\",\"3C_Category\",\"CriteriaSysId\",\"ParentCriteriaName\"\
  ,\"CriteriaName\",\"CriteriaDetails\",\"Competency_SkillSysID\",\"CriteriaDefinition\"\
  ,\n\"Operator\", \"CriteriaMinimumRequirement\", \"CriteriaMinimumRequirementThreshold\"\
  ,\n'random' as \"CriteriaThresholdLowerLimit\",\n\"CriteriaThresholdLowerLimit\"\
  \ - 'random'  as \"CriteriaThresholdUpperLimit\",\n'random' as \"ProgramSegment\"\
  ,\"Active\",\"ValidFrom\",\"ValidTo\",\"UpdatedDate\",\"UpdatedByUser\",\"PublicSectorMultiplier\"\
  \ ,\"WaivedUntil\"\nfrom  ODS_LS.PARTNER.X_SNC_4C_PARTNER_F_3C_RULES\nwhere \"CriteriaSysId\"\
  \ in ('random')\n--\"ParentCriteriaName\" in ('Skilled Sales Resources' )\nand \
  \ \"ProgramSegment\" = 'random' and \"ProgramType\" = 'random' and \"3C_Category\"\
  \ = 'random'\n union all\n    --Skilled Pre-sales Resources\n    select \"ProgramType\"\
  ,\"3C_Category\",\"CriteriaSysId\",\"ParentCriteriaName\",\"CriteriaName\",\"CriteriaDetails\"\
  ,\"Competency_SkillSysID\",\"CriteriaDefinition\",\n\"Operator\", \"CriteriaMinimumRequirement\"\
  , \"CriteriaMinimumRequirementThreshold\",\n'random' as \"CriteriaThresholdLowerLimit\"\
  ,\n\"CriteriaThresholdLowerLimit\" - 'random'  as \"CriteriaThresholdUpperLimit\"\
  ,\n'random' as \"ProgramSegment\",\"Active\",\"ValidFrom\",\"ValidTo\",\"UpdatedDate\"\
  ,\"UpdatedByUser\",\"PublicSectorMultiplier\" ,\"WaivedUntil\"\nfrom  ODS_LS.PARTNER.X_SNC_4C_PARTNER_F_3C_RULES\n\
  where \"CriteriaSysId\" in ('random')\n--\"ParentCriteriaName\" in ('Skilled Pre-sales\
  \ Resources' )\nand  \"ProgramSegment\" = 'random' and \"ProgramType\" = 'random'\
  \ and \"3C_Category\" = 'random'\n union all\n    --Resources completed Sales &\
  \ Messaging Foundations Path (NowLearning)\n    select \"ProgramType\",\"3C_Category\"\
  ,\"CriteriaSysId\",\"ParentCriteriaName\",\"CriteriaName\",\"CriteriaDetails\",\"\
  Competency_SkillSysID\",\"CriteriaDefinition\",\n\"Operator\", \"CriteriaMinimumRequirement\"\
  , \"CriteriaMinimumRequirementThreshold\",\n'random' as \"CriteriaThresholdLowerLimit\"\
  ,\n\"CriteriaThresholdLowerLimit\" - 'random'  as \"CriteriaThresholdUpperLimit\"\
  ,\n'random' as \"ProgramSegment\",\"Active\",\"ValidFrom\",\"ValidTo\",\"UpdatedDate\"\
  ,\"UpdatedByUser\",\"PublicSectorMultiplier\" ,\"WaivedUntil\"\nfrom  ODS_LS.PARTNER.X_SNC_4C_PARTNER_F_3C_RULES\n\
  where \"CriteriaSysId\" in ('random')\n--\"ParentCriteriaName\" in ('Resources completed\
  \ Sales & Messaging Foundations Path (NowLearning)' )\nand  \"ProgramSegment\" =\
  \ 'random' and \"ProgramType\" = 'random' and \"3C_Category\" = 'random'\n     union\
  \ all\n    --Sales and pre-sales competency across # product lines\n    select \"\
  ProgramType\",\"3C_Category\",\"CriteriaSysId\",\"ParentCriteriaName\",\"CriteriaName\"\
  ,\"CriteriaDetails\",\"Competency_SkillSysID\",\"CriteriaDefinition\",\n\"Operator\"\
  , \"CriteriaMinimumRequirement\", \"CriteriaMinimumRequirementThreshold\",\n'random'\
  \ as \"CriteriaThresholdLowerLimit\",\n\"CriteriaThresholdLowerLimit\" - 'random'\
  \  as \"CriteriaThresholdUpperLimit\",\n'random' as \"ProgramSegment\",\"Active\"\
  ,\"ValidFrom\",\"ValidTo\",\"UpdatedDate\",\"UpdatedByUser\",\"PublicSectorMultiplier\"\
  \ ,\"WaivedUntil\"\nfrom  ODS_LS.PARTNER.X_SNC_4C_PARTNER_F_3C_RULES\nwhere \"CriteriaSysId\"\
  \ in ('random')\n--\"ParentCriteriaName\" in ('Sales and pre-sales competency across\
  \ # product lines' )\nand  \"ProgramSegment\" = 'random' and \"ProgramType\" = 'random'\
  \ and \"3C_Category\" = 'random'\n)\n,\nPAR_PARTNERS_ALLDATA AS (SELECT  DISTINCT\
  \ * FROM (\n    SELECT DISTINCT PR.*,\"ParentCriteriaName\",\"CriteriaName\",\"\
  CriteriaThresholdLowerLimit\",\"ProgramSegment\",\"WaivedUntil\"  FROM (SELECT *,ROUND(DATEDIFF\
  \ (DAYS,\"ParentPartnerServicesDate\",  TO_date (convert_timezone('random',LAST_DAY(DATEADD(MONTH,'random',CURRENT_DATE),'random'))))/'random','random')\
  \ AS \"NumOfOnboardedMonths\" FROM EDW_LS.\"PARTNER_EM\".\"PARENTPARTNERS\" WHERE\
  \ \"ParentPartnerCategory\" !='random' OR \"ParentPartnerCategory\" IS NULL )PR\n\
  LEFT JOIN\n(SELECT DISTINCT * FROM C_RULES WHERE \"ProgramType\"='random')RULES\n\
  ON \"ProgramType\"='random'  AND   IFNULL(\"ResellerSegment\",'random')=\"RULES\"\
  .\"ProgramSegment\")),\n    PARTNERS AS (SELECT P.* FROM PAR_PARTNERS_ALLDATA PP\n\
  \                 INNER JOIN\n                 EDW_LS.\"PARTNER_EM\".\"PARTNERS\"\
  \ P\n                ON P.\"ParentPartnerNumber\"=PP.\"ParentPartnerNumber\")\n\
  ,PAR_PARTNERS AS (SELECT DISTINCT \"ParentPartnerSysID\",\n\"ParentPartner\", \"\
  ParentPartnerNumber\",\"ParentPartnerOnBoardedDate\" FROM PAR_PARTNERS_ALLDATA )\n\
  \  ,PARTNERSKILLS AS (SELECT * FROM EDW_LS.\"PARTNER_EM\".\"PPR_PARTNERSSKILLS_VW\"\
  \ WHERE LOWER(\"SkillStatus\") IN ('random', 'random', 'random'))\n,SUBSIDIARY_RESALE\
  \ AS(SELECT * FROM  EDW_LS.PARTNER_EM.PPR_PARTNER_SUBSIDIARY_DETAIL_RESALE_FUTURE12MONTHS),\n\
  SUBSIDIARY_RESALE_PS AS(\nSELECT DISTINCT \"ParentPartnerNumber\",\n\"ParentPartner\"\
  --,\"CriteriaName\"\n    ,IFF( \"WINDOW_COUNT\" = 'random', 'random' , 'random')\
  \ AS \"ParentPartnerPublicSectorFlag\" FROM\n  (\n  SELECT \"ParentPartnerNumber\"\
  ,\n\"ParentPartner\",\n\"PartnerNumber\",\n\"Partner\",\"CriteriaName\"\n\"PartnerPublicSectorFlag\"\
  ,\n                      CASE WHEN \"PartnerPublicSectorFlag\" = 'random' THEN 'random'\
  \ ELSE 'random' END AS \"CNT\",\n     SUM(\"CNT\")   over (partition by \"ParentPartner\"\
  ,\"ParentPartnerNumber\" order by \"ParentPartner\",\"ParentPartnerNumber\") AS\
  \ \"WINDOW_COUNT\" FROM SUBSIDIARY_RESALE\n    WHERE \"CriteriaSysId\" in ( 'random'\
  \ ,'random' ,'random' )\n    --\"CriteriaName\" IN ('Impacted Resale NNACV','Sourced\
  \ Resale NNACV','Approved Deal Registrations')\n    )\n  )\n\n SELECT DISTINCT\n\
  \     EVALUATION_DATA.\"ParentPartnerSysID\",\n\t EVALUATION_DATA.\"ParentPartner\"\
  ,\n\t EVALUATION_DATA.\"ParentPartnerNumber\",\n\t EVALUATION_DATA.\"ProgramType\"\
  ,\n\t EVALUATION_DATA.\"ParentPartnerPublicSectorFlag\",\n\t EVALUATION_DATA.\"\
  ParentPartnerPublicSectorFlagFuture\",\n\t EVALUATION_DATA.\"3C\",\n\t PRN.\"CriteriaName\"\
  \ AS \"Criteria\",\n\t EVALUATION_DATA.\"CriteriaValCompletedDaily\",\n\t EVALUATION_DATA.\"\
  PSCriteriaValCompletedDaily\",\n\t EVALUATION_DATA.\"PotentialCriteriaSegment\"\
  ,\n    CASE\n     WHEN PRN.\"ParentPartnerCategory\"='random' THEN 'random'::VARCHAR('random')\n\
  \     ELSE\n\tROUND(PRN.\"CriteriaThresholdLowerLimit\",'random')::VARCHAR('random')\
  \ END  AS \"CriteriaThresholdLowerLimit\",\n\t EVALUATION_DATA.\"FutureGap\",\n\t\
  \ EVALUATION_DATA.\"PSGap\",\n\t EVALUATION_DATA.\"CriteriaValCompleted12Months_Actual\"\
  ,\n\t EVALUATION_DATA.\"PSCriteriaValCompleted12Months_Actual\",\n     EVALUATION_DATA.\"\
  WTCriteriaValCompleted12Months_Actual\",\n\t EVALUATION_DATA.\"CriteriaValCompleted12Months\"\
  ,\n\t EVALUATION_DATA.\"PSCriteriaValCompleted12Months\",\n     EVALUATION_DATA.\"\
  WTCriteriaValCompleted12Months\",\n\t EVALUATION_DATA.\"CurrentCriteriaSegment\"\
  ,\n\t EVALUATION_DATA.\"Gap\",\n\t EVALUATION_DATA.\"PSFutureGap\",\n\t EVALUATION_DATA.\"\
  MonthlyProgramEvaluatedDate\",\n\t EVALUATION_DATA.\"DailyChangeFlag\",\n\t EVALUATION_DATA.\"\
  DeleteFlagMonthly\",\n\t EVALUATION_DATA.\"DeletedDateMonthly\",\n     PRN.\"WaivedUntil\"\
  \n   -- ,RULES.\"ProgramSegment\",RULES.\"CriteriaThresholdLowerLimit\",\n    --CASE\
  \ WHEN FINAL_DATA.\"ParentPartnerCategory\"=RULES.\"ProgramSegment\" THEN RULES.\"\
  CriteriaThresholdLowerLimit\" ELSE FINAL_DATA.\"CriteriaThresholdLowerLimit\" END\
  \ AS \"NewThreshold\"\n    FROM (SELECT DISTINCT \"ParentPartnerNumber\",\"ParentCriteriaName\"\
  ,\"CriteriaName\",\"ResellerSegment\" AS \"ParentPartnerCategory\",\"CriteriaThresholdLowerLimit\"\
  ,\"WaivedUntil\" from  PAR_PARTNERS_ALLDATA) PRN\n    INNER JOIN (\n    SELECT DISTINCT\n\
  \t\"ParentPartnerSysID\",\n\t\"ParentPartner\",\n\t\"ParentPartnerNumber\",\n\t\"\
  ProgramType\",\n\tIFF(\"WINDOW_COUNT\" = 'random', 'random' , 'random') AS \"ParentPartnerPublicSectorFlag\"\
  ,\n\t\"ParentPartnerPublicSectorFlagFuture\",\n\t\"3C\",\n    \"CriteriaSysId\"\
  ,\n\t\"Criteria\",\n    \"CriteriaValCompletedDaily\",\n\t\"PSCriteriaValCompletedDaily\"\
  ,\n\t\"PotentialCriteriaSegment\",\n    \"CriteriaThresholdLowerLimit\",\n\t\"FutureGap\"\
  ,\n\t\"PSGap\",\n\t\"CriteriaValCompleted12Months_Actual\",\n\t\"PSCriteriaValCompleted12Months_Actual\"\
  ,\n    \"WTCriteriaValCompleted12Months_Actual\",\n\t\"CriteriaValCompleted12Months\"\
  ,\n\t\"PSCriteriaValCompleted12Months\",\n     \"WTCriteriaValCompleted12Months\"\
  ,\n\t\"CurrentCriteriaSegment\",\n\t\"Gap\",\n\t\"PSFutureGap\",\n\t\"MonthlyProgramEvaluatedDate\"\
  ,\n\t\"DailyChangeFlag\",\n\t\"DeleteFlagMonthly\",\n\t\"DeletedDateMonthly\"\n\
  FROM\n    (\n      SELECT *,\n                      CASE WHEN \"ParentPartnerPublicSectorFlag\"\
  \ = 'random' THEN 'random' ELSE 'random' END AS \"CNT\",\n     SUM(\"CNT\")   over\
  \ (partition by \"ParentPartner\",\"ParentPartnerNumber\" order by \"ParentPartner\"\
  ,\"ParentPartnerNumber\") AS \"WINDOW_COUNT\"\n        FROM\n    (\nSELECT DISTINCT\
  \  P.\"ParentPartnerSysID\",P.\"ParentPartner\",\n    P.\"ParentPartnerNumber\"\
  ,P.\"ProgramType\",\n   NVL(E.\"ParentPartnerPublicSectorFlag\",'random') AS \"\
  ParentPartnerPublicSectorFlag\",\n    E.\"ParentPartnerPublicSectorFlagFuture\"\
  ,\n    P.\"3C\",\n    P.\"CriteriaSysId\" AS \"CriteriaSysId\",\n    P.\"ParentCriteriaName\"\
  \ AS \"Criteria\",\n    E.\"CriteriaValCompletedDaily\",\n    E.\"PSCriteriaValCompletedDaily\"\
  ,\n    E.\"PotentialCriteriaSegment\",\n    E.\"CriteriaThresholdLowerLimit\",\n\
  \    E.\"FutureGap\",\n    E.\"PSGap\",\n     CASE WHEN P.\"CriteriaSysId\" in ('random','random')\n\
  \     --\"Criteria\" IN ('Impacted Resale NNACV' ,'Sourced Resale NNACV')\n    \
  \ THEN ROUND(NVL(E.\"CriteriaValCompleted12Months_Actual\",'random') ,'random')\n\
  \        ELSE\n    NVL(E.\"CriteriaValCompleted12Months_Actual\",'random') END AS\
  \ \"CriteriaValCompleted12Months_Actual\" ,\n        CASE WHEN P.\"CriteriaSysId\"\
  \ in ('random','random')\n        --\"Criteria\" IN ('Impacted Resale NNACV' ,'Sourced\
  \ Resale NNACV')\n        THEN ROUND(NVL(E.\"PSCriteriaValCompleted12Months_Actual\"\
  ,'random') ,'random')\n        ELSE\n    NVL(E.\"PSCriteriaValCompleted12Months_Actual\"\
  ,'random') END  AS \"PSCriteriaValCompleted12Months_Actual\" ,\n    CASE WHEN P.\"\
  CriteriaSysId\" in ('random','random')\n    --\"Criteria\" IN ('Impacted Resale\
  \ NNACV' ,'Sourced Resale NNACV')\n    THEN ROUND(NVL(E.\"WTCriteriaValCompleted12Months_Actual\"\
  ,'random') ,'random')\n        ELSE\n    NVL(E.\"WTCriteriaValCompleted12Months_Actual\"\
  ,'random') END  AS \"WTCriteriaValCompleted12Months_Actual\" ,\n        CASE WHEN\
  \ P.\"CriteriaSysId\" in ('random','random')\n        --\"Criteria\" IN ('Impacted\
  \ Resale NNACV' ,'Sourced Resale NNACV')\n        THEN ROUND(NVL(E.\"CriteriaValCompleted12Months\"\
  ,'random') ,'random')\n        ELSE\n    NVL(E.\"CriteriaValCompleted12Months\"\
  ,'random') END  AS \"CriteriaValCompleted12Months\",\n         CASE WHEN P.\"CriteriaSysId\"\
  \ in ('random','random')\n         --\"Criteria\" IN ('Impacted Resale NNACV' ,'Sourced\
  \ Resale NNACV')\n         THEN ROUND(NVL(E.\"PSCriteriaValCompleted12Months\",'random')\
  \ ,'random')\n        ELSE\n    NVL(E.\"PSCriteriaValCompleted12Months\",'random')\
  \ END AS \"PSCriteriaValCompleted12Months\",\n     CASE WHEN P.\"CriteriaSysId\"\
  \ in ('random','random')\n     --\"Criteria\" IN ('Impacted Resale NNACV' ,'Sourced\
  \ Resale NNACV')\n     THEN ROUND(NVL(E.\"WTCriteriaValCompleted12Months\",'random')\
  \ ,'random')\n        ELSE\n    NVL(E.\"WTCriteriaValCompleted12Months\",'random')\
  \ END AS \"WTCriteriaValCompleted12Months\",\n     CASE WHEN P.\"CriteriaSysId\"\
  \ in ('random')\n     --P.\"ParentCriteriaName\" IN ('Sourced Resale NNACV')\n \
  \    THEN NVL(E.\"CurrentCriteriaSegment\",'random')\n   ELSE NVL(E.\"CurrentCriteriaSegment\"\
  ,'random')\n    END\n    AS \"CurrentCriteriaSegment\",--INC0998252\n     CASE WHEN\
  \ P.\"CriteriaSysId\" in ('random','random')\n     --\"Criteria\" IN ('Impacted\
  \ Resale NNACV' ,'Sourced Resale NNACV')\n     THEN ROUND(NVL(E.\"Gap\",'random')\
  \ ,'random')\n      ELSE\n        ROUND(NVL(E.\"Gap\",'random'),'random') END AS\
  \ \"Gap\",\n    E.\"PSFutureGap\" ,\n    E.\"MonthlyProgramEvaluatedDate\",\n  \
  \  E.\"DailyChangeFlag\",\n    E.\"DeleteFlagMonthly\",\n    E.\"DeletedDateMonthly\"\
  \nFROM (SELECT DISTINCT PA.\"ParentPartner\",PP.\"ParentPartnerSysID\",\n    PA.\"\
  ParentPartnerNumber\",R.\"ProgramType\",TRIM(R.\"ParentCriteriaName\") as \"ParentCriteriaName\"\
  ,\"3C_Category\" AS \"3C\", R.\"CriteriaSysId\" as \"CriteriaSysId\"\n      FROM\
  \ EDW_LS.\"PARTNER_EM\".\"PARTNERS\" PA\n     INNER JOIN EDW_LS.\"PARTNER_EM\".\"\
  PARENTPARTNERS\" PP\n      ON PA.\"ParentPartnerNumber\"= PP.\"ParentPartnerNumber\"\
  \n    INNER JOIN C_RULES R\n    ON R.\"ProgramType\" = 'random'\nWHERE PA.\"PartnerSalesTierLevel\"\
  \ = 'random')P\nLEFT JOIN\n    (\nSELECT \"ParentPartnerSysID\",\n\t\"ParentPartner\"\
